import React from "react";
import Project from "../components/pages/Project";

const ProjectsList = () => {
  const projects = [
    {
      title: "Video service",
      image: "/images/projects/01-thumb.jpg",
      imageAlt: "Video service",
      copy: "Bla bla dasdaasds dqweqedqw. Bla bla dasdaasds dqweqedqw. Bla bla dasdaasds dqweqedqw",
    },
    {
      title: "HUI",
      image: "/images/projects/02-thumb.jpg",
      imageAlt: "HUI",
      copy: "Bla bla dasdaasds dqweqedqw. Bla bla dasdaasds dqweqedqw. Bla bla dasdaasds dqweqedqw",
    },
  ];

  return (
    <div className="main__wrapper">
      {projects.map((project, index) => (
        <Project key={index} />
      ))}
    </div>
  );
};

export default ProjectsList;
